    /**
     * Gets a point in a potentially-infinite aperiodically-tiling plane of blue noise, where each 128x128 square of
     * blue noise is drawn from {@link #ALT_TRI_NOISE} (which is blue noise with a triangular mapping). The triangular
     * mapping may improve the appearance of the blue noise when used for dithering or other smoothly-fading gradients.
     * Because each square of ALT_TRI_NOISE can tile with any other from that group, this can choose those squares
     * randomly, and it does so using a simplistic (and fast) hash based on Cantor's pairing function.
     * <br>
     * The blue noise this produces will consider {@link Byte#MIN_VALUE} to be the lowest value and
     * {@link Byte#MAX_VALUE} to be the highest, which allows comparing bytes from this with greater-than and less-than
     * directly. No mask is needed, and using a mask of 255 will not yield good blue noise, but adding 128 will get you
     * ints from 0 to 255.
     * <br>
     * This makes high-quality blue noise that satisfies the
     * progressive quality. Big thanks to Bart Wronski for making Ulichney's Void and Cluster algorithm accessible to
     * me, and Alan Wolfe for helping me understand how useful blue noise is in the first place!
     * <br>
     * <a href="https://i.imgur.com/4bE8iKt.png">Blue noise at left, magnitude histogram at right.</a>
     * @param x x coordinate, in grid cells, pixels, or some other fine-grained measurement
     * @param y y coordinate, in grid cells, pixels, or some other fine-grained measurement
     * @param seed only the low 12 bits will be used
     * @return a byte obeying a triangular-mapped blue noise distribution, where the byte value -128 is darkest and 127 is lightest
     */
    public static byte getSeededUniform(final int x, final int y, int seed) {
        final int a = x >>> 7 ^ seed >>> 4;
        final int b = y >>> 7 ^ seed >>> 8;
        return ALT_NOISE[seed + b + ((a + b) * (a + b + 1) >> 1) & 15][(y << 7 & 0x3F80) | (x & 0x7F)];
    }

    /**
     * Identical to {@link #getSeededUniform(int, int, int)} with a seed of 0, very slightly optimized.
     * @param x x coordinate, in grid cells, pixels, or some other fine-grained measurement
     * @param y y coordinate, in grid cells, pixels, or some other fine-grained measurement
     * @return a byte obeying a triangular-mapped blue noise distribution, where the byte value -128 is darkest and 127 is lightest
     */
    public static byte getUniform(final int x, final int y) {
        final int a = x >>> 7;
        final int b = y >>> 7;
        return ALT_NOISE[b + ((a + b) * (a + b + 1) >> 1) & 15][(y << 7 & 0x3F80) | (x & 0x7F)];
    }

