    /**
     * Gets a point in a potentially-infinite aperiodically-tiling plane of blue noise, where each 64x64 square of blue
     * noise is drawn from {@link #TILE_NOISE}. Because each square of TILE_NOISE can tile with any other from that
     * group, this can choose those squares randomly, and it does so using a simplistic (and fast) hash based on
     * Cantor's pairing function. Unlike earlier attempts here to make aperiodic tilings of blue noise, this makes
     * high-quality blue noise that satisfies the progressive quality.
     * <br>
     * The blue noise this produces will consider {@link Byte#MIN_VALUE} to be the lowest value and
     * {@link Byte#MAX_VALUE} to be the highest, which allows comparing bytes from this with greater-than and less-than
     * directly. No mask is needed, and using a mask of 255 will not yield good blue noise, but adding 128 will get you
     * ints from 0 to 255.
     * <br>
     * Big thanks to Bart Wronski for making Ulichney's Void and Cluster algorithm accessible to me, and Alan Wolfe for
     * helping me understand how useful blue noise is in the first place!
     * <br>
     * <a href="https://i.imgur.com/aIRKSaO.png">Blue noise at left, magnitude histogram at right.</a>
     * @param x x coordinate, in grid cells, pixels, or some other fine-grained measurement
     * @param y y coordinate, in grid cells, pixels, or some other fine-grained measurement
     * @param seed only the low 18 bits will be used, so this should probably be between 0 and 250000, roughly
     * @return a byte obeying a blue noise distribution
     */
    public static byte getSeededOmniTiling(final int x, final int y, final int seed) {
        final int a = x >>> 6 ^ seed >>> 6;
        final int b = y >>> 6 ^ seed >>> 12;
        return TILE_NOISE[seed + b + ((a + b) * (a + b + 1) >> 1) & 63][(y << 6 & 0xFC0) | (x & 0x3F)];
    }

